        public static Fp shuffle(Fp3 a, Fp3 b, ShuffleComponent x)
        {
            return select_shuffle_component(a, b, x);
        }

        /// <summary>Returns the result of specified shuffling of the components from two Fp3 vectors into a Fp2 vector.</summary>
        [MethodImpl(MethodImplOptions.AggressiveInlining)]
        public static Fp2 shuffle(Fp3 a, Fp3 b, ShuffleComponent x, ShuffleComponent y)
        {
            return Fp2(
                select_shuffle_component(a, b, x),
                select_shuffle_component(a, b, y));
        }

        /// <summary>Returns the result of specified shuffling of the components from two Fp3 vectors into a Fp3 vector.</summary>
        [MethodImpl(MethodImplOptions.AggressiveInlining)]
        public static Fp3 shuffle(Fp3 a, Fp3 b, ShuffleComponent x, ShuffleComponent y, ShuffleComponent z)
        {
            return Fp3(
                select_shuffle_component(a, b, x),
                select_shuffle_component(a, b, y),
                select_shuffle_component(a, b, z));
        }

        /// <summary>Returns the result of specified shuffling of the components from two Fp3 vectors into a Fp4 vector.</summary>
        [MethodImpl(MethodImplOptions.AggressiveInlining)]
        public static Fp4 shuffle(Fp3 a, Fp3 b, ShuffleComponent x, ShuffleComponent y, ShuffleComponent z, ShuffleComponent w)
        {
            return Fp4(
                select_shuffle_component(a, b, x),
                select_shuffle_component(a, b, y),
                select_shuffle_component(a, b, z),
                select_shuffle_component(a, b, w));
        }

        [MethodImpl(MethodImplOptions.AggressiveInlining)]
        internal static Fp select_shuffle_component(Fp3 a, Fp3 b, ShuffleComponent component)
        {
            switch(component)
            {
                case ShuffleComponent.LeftX:
                    return a.x;
                case ShuffleComponent.LeftY:
                    return a.y;
                case ShuffleComponent.LeftZ:
                    return a.z;
                case ShuffleComponent.RightX:
                    return b.x;
                case ShuffleComponent.RightY:
                    return b.y;
                case ShuffleComponent.RightZ:
                    return b.z;
                default:
                    throw new System.ArgumentException("Invalid shuffle component: " + (int)component);
            }
        }

    }
